import React from 'react';

const Blogs = () => {
return (
	<>
		<div className='container'
		   style={{
			display: 'flex',
			justifyContent: 'center',
			alignItems: 'center',
			height: '100vh'
		}}>
			   <div className='box'>
				   <h1>About Us</h1>
			   </div>
		</div>
	</>
);
};

export default Blogs;
